--
-- Name: func_create_table_partitions_with_datimid(text); Type: FUNCTION; Schema: public; Owner: lamisplus
--

CREATE FUNCTION public.func_create_table_partitions_with_datimid(stg_table_name text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    new_stg_table_table TEXT;
	unique_partition_part TEXT;
	load_time timestamp;
	inputs text[];
    input text;
	partition_name text;

BEGIN
	SELECT TIMEOFDAY() INTO load_time;

	SELECT array_agg(datim_id)
	INTO inputs
	FROM public.central_partner_mapping;
	
	-- form new table name
	new_stg_table_table := CONCAT('public.new_',stg_table_name);
	unique_partition_part := REPLACE(stg_table_name,'stg_','');
	
    -- Loop through each input value and execute the dynamic query
    FOREACH input IN ARRAY inputs
    LOOP
        partition_name := CONCAT(unique_partition_part,'_',input);
        
		EXECUTE format('
            DROP TABLE IF EXISTS public.%I
           ', partition_name);
			
        -- Loop through and create partitions
        EXECUTE format('
            CREATE TABLE IF NOT EXISTS public.%I 
            PARTITION OF %s
            FOR VALUES IN (%L)', partition_name,new_stg_table_table, input);
		
		-- Print the stg_table_name
    	RAISE NOTICE '% partition successfully created on %', partition_name, new_stg_table_table;
    END LOOP;
		
    -- Commit transaction for the current lab test
    PERFORM pg_advisory_xact_lock(hashtext(new_stg_table_table));
END;
$$;


